window.bookSummaryJSON = "<p>Four ways to piss off the Queen of Hearts: </p> <ol> <li>Have a name that sounds kind of like Alice. </li> <li>Change the decor in her favorite club.</li> <li>Destroy the magic she's used to hold Wonderland in her cruel grasp. </li> <li>Fail to offer your head in penance. </li> </ol> <p>I didn't come to this bizarre, intoxicating place looking for trouble, but I've sure as hell found it. As the Queen retaliates viciously against the Spades' rebellion, it's up to me and the three alluring men I've allied with to save Wonderland before so many innocents lose their heads. </p> <p>Easier said than done. With Hatter tapping into his inner Mad, Chess pulling a vanishing act, and the White Knight revealing secrets darker than I could have imagined, everything I counted on here has turned upside down. When the swords come out, will I even be able to save myself? </p> <p>Contains mature themes.</p>"; 
